.text		
MainGame:
	# give the player three lives on game start
	addi $t0, $zero, 3
	sw $t0, numberOfLives
	
	jal ResetGoalFrogs  # reset the goal frogs on game start
MainGameLoop:
	lw $t0, numberOfLives  # load the value for run game 
	beq $t0, 0, CheckPlayAgain  # if numberOfLives is zero, end the game, otherwise continue running
	
	# check for input and update the frog position
	jal CheckForInput
	
	# check for collision
	jal CheckForCollision
	
	# update the positions of the objects on the screen 
	#jal UpdatePositions
	
	# Draw the game
	jal DrawGame
	
	jal Sleep
	
	j MainGameLoop  # restart game loop
CheckPlayAgain:
	jal DrawPlayAgainScreen
CheckPlayAgainLoop:
	lw $t0, 0xffff0000  # check if there is an input
	bne $t0, 1, CheckPlayAgainLoop  # if there is no input, keep checking
	# if there is an input
	lw $t0, 0xffff0004  # check the value of the input
	
	# if the user presses y restart the game
	beq $t0, 121, MainGame
	beq $t0, 89, MainGame
	
	# if the user presses n end the game
	beq $t0, 110, EndGame
	beq $t0, 78, EndGame
	
	# if the user pressed anything else check again
	j CheckPlayAgainLoop
EndGame:
	jal DrawBlackScreen
	j Exit
	
CheckForCollision:
	lw $s0, frogY  # load the current Y position of the frog
	mul $s0, $s0, 128  # translate the Y position into pixels
	
	# check if the frog is in the goal region
	addi $t3, $zero, 12288
	beq $s0, $t3, CheckGoalRow
	
	# check if the frog is on the first row
	lw $t3, row1Y  # load the y value of the row
	lw $t0, row1X  # load the X value of the row
	addi $t1, $zero, 96
	addi $t2, $zero, 168
	lw $s7, row1Speed
	beq $s0, $t3, CheckWaterRow
	
	# check if the frog is on the second row
	lw $t3, row2Y  # load the y value of the row
	lw $t0, row2X  # load the X value of the row
	addi $t1, $zero, 96
	addi $t2, $zero, 168
	lw $s7, row2Speed
	beq $s0, $t3, CheckWaterRow
	
	# check if the frog is on the third row
	lw $t3, row3Y  # load the y value of the row
	lw $t0, row3X  # load the X value of the row
	addi $t1, $zero, 156
	addi $t2, $zero, 256
	lw $s7, row3Speed
	beq $s0, $t3, CheckWaterRow
	
	# check if the frog is on the fourth row
	lw $t3, row4Y  # load the y value of the row
	lw $t0, row4X  # load the X value of the row
	addi $t1, $zero, 96
	addi $t2, $zero, 168
	lw $s7, row4Speed
	beq $s0, $t3, CheckWaterRow
	
	# check if the frog is on the fifth row
	lw $t3, row5Y  # load the y value of the row
	lw $t0, row5X  # load the X value of the row
	addi $t1, $zero, 96
	addi $t2, $zero, 168
	lw $s7, row5Speed
	beq $s0, $t3, CheckWaterRow
	
	# check if the frog is on the sixth row
	lw $t3, row6Y  # load the y value of the row
	lw $t0, row6X  # load the X value of the row
	addi $t1, $zero, 64
	addi $t2, $zero, 256
	beq $s0, $t3, CheckRoadRow
	
	# check if the frog is on the seventh row
	lw $t3, row7Y  # load the y value of the row
	lw $t0, row7X  # load the X value of the row
	addi $t1, $zero, 32
	addi $t2, $zero, 168
	beq $s0, $t3, CheckRoadRow
	
	# check if the frog is on the eigth row
	lw $t3, row8Y  # load the y value of the row
	lw $t0, row8X  # load the X value of the row
	addi $t1, $zero, 32
	addi $t2, $zero, 168
	beq $s0, $t3, CheckRoadRow
	
	# check if the frog is on the ninth row
	lw $t3, row9Y  # load the y value of the row
	lw $t0, row9X  # load the X value of the row
	addi $t1, $zero, 32  # width of sprite
	addi $t2, $zero, 168  # full width of sprite, including excess spacing
	beq $s0, $t3, CheckRoadRow  # if the frog is in the row, check if there's an overlap
	
	# check if the frog is on the tenth row
	lw $t3, row10Y  # load the y value of the row
	lw $t0, row10X
	addi $t1, $zero, 32
	addi $t2, $zero, 168
	beq $s0, $t3, CheckRoadRow
FinishedCollisionCheck:
	jr $ra
CheckGoalRow:
	add $s1, $zero, $zero  # number of loop iterations
	addi $s2, $zero, 32  # position to start drawing from
	# save the current $ra
	addi $sp, $sp, -4
	sw $ra, 0($sp)
CheckGoalLoop:
	beq $s1, 5, EndGoalLoop  # if we've looped through all the goals spaces
	# pass the location of the sprite
	addi $sp, $sp, -4
	sw $s2, 0($sp)
	
	# pass the hazardous width of the sprite
	addi $t1, $zero, 48
	addi $sp, $sp, -4
	sw $t1, 0($sp)
	
	# pass the full width of the sprite
	addi $t2, $zero, 512
	addi $sp, $sp, -4
	sw $t2, 0($sp)
	
	jal HasOverlap  # check if there is an overlap
	
	lb $v0, 0($sp)  # load the return value, 0 is no overlap, 1 is has overlap
	addi $sp, $sp, 4
	
	beq $v0, 1, FrogInGoal
	addi $s1, $s1, 1  # decrement the loop counter by 1
	addi $s2, $s2, 100  # increment to the next start position
	j CheckGoalLoop
FrogInGoal:
	# set the frog in that goal spot
	addi $t0, $zero, 1
	la $t1, goalFrogs 
	mul $s1, $s1, 4  # get the address offset
	add $t1, $t1, $s1  # increment the address by the offset
	sw $t0, 0($t1)
EndGoalLoop:
	# set the player to the starting point 
	addi $t0, $zero, 256
	sw $t0, frogX
	addi $t0, $zero, 480
	sw $t0, frogY
	
	# increment the users score by 50
	lw $t0, score
	addi $t0, $t0, 50  
	sw $t0, score
	
	lw $ra, 0($sp)  # restore the return address
	addi $sp, $sp, 4
	
	j FinishedCollisionCheck
CheckWaterRow:
	# save the current $ra
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	# pass the location of the sprite
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	
	# pass the hazardous width of the sprite
	addi $sp, $sp, -4
	sw $t1, 0($sp)
	
	# pass the full width of the sprite
	addi $sp, $sp, -4
	sw $t2, 0($sp)
	
	jal HasOverlap  # check if there is an overlap
	
	lb $v0, 0($sp)  # load the return value, 0 is no overlap, 1 is has overlap
	addi $sp, $sp, 4
	
	lw $ra, 0($sp)  # restore the return address
	addi $sp, $sp, 4
	
	beq $v0, 0, TriggerLifeLoss  # if there no collision, then the frog is in water
FrogFloating:  # if frog is not in water/is collided with an object
	lw $t1, frogX  # load the x value of the frog
	add $t1, $t1, $s7  # move the frog at the same speed as the object
	# if the frog moves offscreen, player loses life
	bgt $t1, 480, TriggerLifeLoss
	blt $t1, 0, TriggerLifeLoss
	
	# if the frog is in a valid position
	sw $t1, frogX
	j FinishedCollisionCheck  # otherwise the collision check is finished

CheckRoadRow:
	# save the current $ra
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	# pass the location of the sprite
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	
	# pass the hazardous width of the sprite
	addi $sp, $sp, -4
	sw $t1, 0($sp)
	
	# pass the full width of the sprite
	addi $sp, $sp, -4
	sw $t2, 0($sp)
	
	jal HasOverlap  # check if there is an overlap
	
	lb $v0, 0($sp)  # load the return value, 0 is no overlap, 1 is has overlap
	addi $sp, $sp, 4
	
	lw $ra, 0($sp)  # restore the return address
	addi $sp, $sp, 4
	
	beq $v0, 0, FinishedCollisionCheck  # if there is no collision, finish the check
TriggerLifeLoss:
	# if there is a collision, set the player to the starting point 
	addi $t0, $zero, 256
	sw $t0, frogX
	addi $t0, $zero, 480
	sw $t0, frogY
	# lose a life if there is a collision
	lw $t0, numberOfLives
	addi $t0, $t0, -1
	sw $t0, numberOfLives
	
	j FinishedCollisionCheck
	
	
HasOverlap:
	lw $a2, 0($sp)  # load the width of the sprite into $a2
	addi $sp, $sp, 4
	lw $a1, 0($sp)  # load the hazardous width of the sprite into $a1
	addi $sp, $sp, 4
	lw $a0, 0($sp)  # load the beginning position of the sprite into $a0
	addi $sp, $sp, 4
	
	# store the number of times the sprite is drawn in $t0
	addi $t0, $zero, 512
	div $t0, $t0, $a2
CheckOverlapLoop:
	beq $t0, 0, NoOverlapFound  # if we've iterated through all the sprites and none have overlaps, then there are no overlaps
	lw $t1, frogX  # store the x position of the frog in $t1
	# a0 is the start positin, $t2 is the end position
	add $t2, $a0, $a1  # the end position
	ble $t2, 512, NoWrapCheck  # if the endpoint of the sprite wraps around, deal with this on a case by case basis
HasWrapCheck:  # case $t2 < $a0, endpoint less than start point
	addi $t2, $t2, -512
	# if the frog is not contained between $t2 and $a0 then it overlaps
	ble $t1, $t2, OverlapFound  # if the starting pixel of the frog is before the starting pixel of the middle area, there is an overlap
	addi $t1, $t1, 32
	bge $t1, $a0, OverlapFound # if the ending pixel of the frog is after the ending pixel of the middle area, there is a overlap
	j GoToNextOverlapLoop  # if the frog is contained in the middle area, there is no overlap, so go to the next sprite position
NoWrapCheck:  # case $a0 <= $t2
	bgt $t1, $t2, GoToNextOverlapLoop  # if the start point is past the end point of the sprite, no overlap
	addi $t1, $t1, 32  # end pixel of frog
	blt $t1, $a0, GoToNextOverlapLoop  # if the end point of the frog is before the start point of the sprite, no overlap
	j OverlapFound  # otherwise there is an overlap
GoToNextOverlapLoop:
	addi $t0, $t0, -1  # decrement $t0 by 1
	add $a0, $a0, $a2  # increment $a0 to the next starting sprite pixel
	blt $a0, 512, CheckOverlapLoop  # if the x position of the sprite is on the next line
	addi $a0, $a0, -512 #  subtrat 512 from it so it's on this line
	j CheckOverlapLoop
OverlapFound:
	addi $sp, $sp, -4
	addi $t0, $zero, 1
	sb $t0, 0($sp)
	jr $ra
NoOverlapFound:
	addi $sp, $sp, -4
	sb $zero, 0($sp)
	jr $ra
	
	
	
CheckForInput:
	lw $t0, 0xffff0000  # check if there is an input
	beq $t0, 1, HandleInput  # if there is an input, handle it
	jr $ra   # otherwise return
HandleInput:
	lw $t0, 0xffff0004  # check the value of the input
	
	add $s4, $t0, $zero
	
	# if the input is an W
	beq $t0, 87, HandleW
	beq $t0, 119, HandleW
	
	# if the input is an A
	beq $t0, 97, HandleA
	beq $t0, 65, HandleA
	
	# if the input is an S
	beq $t0, 115, HandleS
	beq $t0, 83, HandleS
	
	# if the input is an D
	beq $t0, 68, HandleD
	beq $t0, 100, HandleD
	
	jr $ra
HandleW:
	lw $t0, frogY  # load the y position of the frog
	addi $t0, $t0, -32  # move the frog up 32
	sw $t0, frogY  # save the new position of the frog
	la $t0, frogUp  # load the address of the new frog sprite
	sw $t0, currentFrog   # make the current frog sprite the new sprite
	jr $ra
HandleA:
	lw $t0, frogX  # load the x position of the frog
	addi $t0, $t0, -32  # move the frog left by 32
	la $t1, frogLeft  # save the address of the new sprite in $t1
	bge $t0, 0, SaveFrogXPosition  # if the x value is negative, make it positive, otherwise save the x value
	addi $t0, $t0, 32
SaveFrogXPosition:
	sw $t0, frogX  # save the x position of the frog
	sw $t1, currentFrog  # save the address of the new sprite in currentFrog
	jr $ra 
HandleS:
	lw $t0, frogY  # load the y position of the frog
	addi $t0, $t0, 32  # move the frog down 32
	ble $t0, 480, SaveFrogYPosition  # if frog is out of bounds bring it back in bounds, otherwise just save the position
	addi $t0, $t0, -32
SaveFrogYPosition:	
	sw $t0, frogY  # save the y position
	la $t0, frogDown  # load the new frog sprite
	sw $t0, currentFrog  # save the new frog sprite as the current frog sprite
	jr $ra
HandleD:
	lw $t0, frogX  # load the x position of the frog
	addi $t0, $t0, 32  # move the frog right by 32
	la $t1, frogRight  # load the frog facing right sprite
	ble $t0, 480, SaveFrogXPosition  #  if frog is out of bounds bring it back in bounds, otherwise just save the position
	addi $t0, $t0, -32
	j SaveFrogXPosition


UpdatePositions:
	# save the current return address
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	# increment the first row to the right
	lw $t0, row1Speed  # pass the increment amount
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	la $t0, row1X  # pass the address of the x position
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal IsPositionInRange
	
	# increment the second row to the left
	lw $t0, row2Speed # pass the increment amount
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	la $t0, row2X  # pass the address of the x position
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal IsPositionInRange
	
		
	# increment the third row to the right
	lw $t0, row3Speed   # pass the increment amount
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	la $t0, row3X  # pass the address of the x position
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal IsPositionInRange
	
	# increment the fourth row to the left
	lw $t0, row4Speed   # pass the increment amount
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	la $t0, row4X  # pass the address of the x position
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal IsPositionInRange
	
	# increment the fifth row to the right
	lw $t0, row5Speed   # pass the increment amount
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	la $t0, row5X  # pass the address of the x position
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal IsPositionInRange
	
	# increment the sixth row to the left
	lw $t0, row6Speed   # pass the increment amount
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	la $t0, row6X  # pass the address of the x position
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal IsPositionInRange
	
	# increment the seventh row to the right
	lw $t0, row7Speed   # pass the increment amount
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	la $t0, row7X  # pass the address of the x position
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal IsPositionInRange
	
	# increment the eigth row to the left
	lw $t0, row8Speed   # pass the increment amount
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	la $t0, row8X  # pass the address of the x position
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal IsPositionInRange
	
		
	# increment the nineth row to the right
	lw $t0, row9Speed   # pass the increment amount
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	la $t0, row9X  # pass the address of the x position
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal IsPositionInRange
	
	# increment the tenth row to the left
	lw $t0, row10Speed   # pass the increment amount
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	la $t0, row10X  # pass the address of the x position
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal IsPositionInRange
	
	# restore the $ra and return
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
	
IsPositionInRange:
	lw $a0, 0($sp)  # load the current X position address
	addi $sp, $sp, 4
	
	lw $a1, 0($sp)  # load the increment amount
	addi $sp, $sp, 4
	
	lw $t0, 0($a0)  # load the current X position value
	add $t0, $t0, $a1
	bge $t0, 0, IsGreaterThan512
	addi $t0, $t0, 512
	j IsInRange
IsGreaterThan512:
	blt $t0, 512, IsInRange
	addi $t0, $t0, -512
IsInRange:
	sw $t0, 0($a0) 
	jr $ra
	
DrawGame:
	sw $ra, 0($sp)  # save the current current address to the stack
	# draw the different regions (water + road + goal)
	jal DrawWater
	jal DrawRoad
	jal DrawGoalRegion
	
	# draw safe zones (spawn and middle)
	addi $sp, $sp, -4 
	lw $t1, spawnPos  # load the spawnPos into $t1
	sw $t1, 0($sp)  # pass the spawnPos to DrawSafeZone
	jal DrawSafeZone
	
	addi $sp, $sp, -4
	lw $t1, safeZonePos  # load the safeZonePos into $t1
	sw $t1, 0($sp)  # pass the safeZonePos to DrawSafeZone
	jal DrawSafeZone
	
	# draw the logs in the first row
	lw $t0, row1X
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	lw $t0, row1Y
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal DrawShortLog
	
	# draw the turtles in the second row
	lw $t0, row2X
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	lw $t0, row2Y
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal DrawTurtle
	
	# draw the logs in the third row
	lw $t0, row4X
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	lw $t0, row4Y
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal DrawShortLog
	
	# draw the logs in the fourth row
	jal DrawRow3Log
	
	# draw the turtles in the fifth row
	lw $t0, row5X
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	lw $t0, row5Y
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal DrawTurtle
	
	# Draw the truck in the sixth row
	jal DrawTruck
	
	# Draw the car in the seventh row
	la $t0, greyPointRaceCar
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	lw $t0, row7X
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	lw $t0, row7Y
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal DrawCar
	
	# Draw the car in the eigth row
	la $t0, pinkCar
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	lw $t0, row8X
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	lw $t0, row8Y
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal DrawCar
	
	# Draw the car in the ninth row
	la $t0, greyRaceCarSpoiler
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	lw $t0, row9X
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	lw $t0, row9Y
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal DrawCar
	
	# Draw the car in the tenth row
	la $t0, yellowPointRaceCar
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	lw $t0, row10X
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	lw $t0, row10Y
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal DrawCar
	
	# pass the x and y parameters into the draw frog function
	lw $t0, frogY
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	
	lw $t0, frogX
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	
	lw $t0, currentFrog  # pass the frog sprite in
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	jal DrawFrog
	
	jal DrawGoalFrogs
	
	lw $ra, 0($sp)  # load the current return address
	jr $ra
	
DrawGoalFrogs:
	# save the current ra
	addi $sp, $sp -4
	sw $ra, 0($sp)
	
	addi $s0, $zero, 40  # the starting goal spot 
	la $s1, goalFrogs  # load the array of goal frogs
DrawGoalFrogsLoop:
	beq $s0, 540, EndGoalFrogsLoop
	lw $t0, 0($s1)
	beq $t0, 0, GoToNextGoalFrogsLoop  # if there is not supposed to be a frog, don't draw it
	# pass the y value
	addi $t0, $zero, 96
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	
	#pass the x value
	addi $sp, $sp, -4
	sw $s0, 0($sp)
	
	la $t2, frogUp
	addi $sp, $sp, -4
	sw $t2, 0($sp)
	jal DrawFrog
GoToNextGoalFrogsLoop:
	addi $s0, $s0, 100
	addi $s1, $s1, 4
	j DrawGoalFrogsLoop
EndGoalFrogsLoop:
	#load the saved ra
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	
	jr $ra

DrawTruck:
	addi $sp, $sp, -4
	sw $ra, 0($sp)  # store the current $ra value overriting the sprite data
	add $s0, $zero, $zero  # initialize the x offset to zero
DrawTruckLoop:
	beq $s0, 512, EndTruckLoop  # if the loop has iterated three times, end it
	
	# pass the sprite into the function
	la $t0, truck
	addi $sp, $sp, -4 
	sw $t0, 0($sp) 
	
	# pass the beginning pixel into the function
	lw $t0, row6X  # load the x position of the log into $t0
	add $t0, $t0, $s0  # add the x offset to the x position
	
	blt $t0, 512, StoreFirstTruckPixelPosition  # if the x position is greater than 512 due to the offset
	addi $t0, $t0, -512  # subtract 512 from it, that is, $t0 = $t0 % 512
StoreFirstTruckPixelPosition:
	lw $t1, row6Y  # load the y position of the frog into $t1
	# calculate the beginning pixel of the sprite
	add $t1, $t1, $t0
	la $t2, 0($gp)  # load the display address
	add $t1, $t1, $t2  # add the pixel offset to the display address
	addi $sp, $sp, -4 
	sw $t1, 0($sp)  # store the beginning pixel in the stack
	
	# pass the area of the sprite
	addi $t0, $zero, 4096
	addi $sp, $sp, -4 
	sw $t0, 0($sp)
	
	# pass the row width of the sprite
	addu $t0, $zero, 64
	addi $sp, $sp, -4
	sw $t0, 0($sp)

	jal DrawSprite
	
	addi $s0, $s0, 256  # increment the x offset for the next log
	j DrawTruckLoop
EndTruckLoop:	
	# load the current $ra
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra	
	
	
DrawCar:
	lw $s2, 0($sp)  # load the y position value into $s2
	addi $sp, $sp, 4
	
	lw $s1, 0($sp)  # load the x position value into $s1
	addi $sp, $sp, 4
	
	lw $s3, 0($sp)  # load the sprite into $s3
	sw $ra, 0($sp)  # store the current $ra value overriting the sprite data
	add $s0, $zero, $zero  # initialize the x offset to zero
DrawCarLoop:
	beq $s0, 504, EndCarLoop  # if the loop has iterated three times, end it
	
	# pass the sprite into the function
	addi $sp, $sp, -4 
	sw $s3, 0($sp) 
	
	# pass the beginning pixel into the function
	add $t0, $zero, $s1  # load the x position of the log into $t0
	add $t0, $t0, $s0  # add the x offset to the x position
	
	blt $t0, 512, StoreFirstCarPixelPosition  # if the x position is greater than 512 due to the offset
	addi $t0, $t0, -512  # subtract 512 from it, that is, $t0 = $t0 % 512
StoreFirstCarPixelPosition:
	add $t1, $zero, $s2  # load the y position of the frog into $t1
	# calculate the beginning pixel of the sprite
	add $t1, $t1, $t0
	la $t2, 0($gp)  # load the display address
	add $t1, $t1, $t2  # add the pixel offset to the display address
	addi $sp, $sp, -4 
	sw $t1, 0($sp)  # store the beginning pixel in the stack
	
	# pass the area of the sprite
	addi $t0, $zero, 4096
	addi $sp, $sp, -4 
	sw $t0, 0($sp)
	
	# pass the row width of the sprite
	addu $t0, $zero, 32
	addi $sp, $sp, -4
	sw $t0, 0($sp)

	jal DrawSprite
	
	addi $s0, $s0, 168  # increment the x offset for the next log
	j DrawCarLoop
EndCarLoop:	
	# load the current $ra
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
	
DrawShortLog:
	lw $s2, 0($sp)  # load the y position value into $s2
	addi $sp, $sp, 4
	
	lw $s1, 0($sp)  # load the x position value into $s1
	addi $sp, $sp, 4
	
	addi $sp, $sp, -4
	sw $ra, 0($sp)  # store the current $ra value
	add $s0, $zero, $zero  # initialize the x offset to zero
DrawShortLogLoop:
	beq $s0, 504, EndShortLogLoop  # if the loop has iterated three times, end it
	
	# pass the sprite into the function
	addi $sp, $sp, -4 
	la $t1, shortLog
	sw $t1, 0($sp) 
	
	# pass the beginning pixel into the function
	add $t0, $zero, $s1  # load the x position of the log into $t0
	add $t0, $t0, $s0  # add the x offset to the x position
	
	blt $t0, 512, StoreFirstShortLogPixelPosition  # if the x position is greater than 512 due to the offset
	addi $t0, $t0, -512  # subtract 512 from it, that is, $t0 = $t0 % 512
StoreFirstShortLogPixelPosition:
	add $t1, $zero, $s2  # load the y position of the frog into $t1
	# calculate the beginning pixel of the sprite
	add $t1, $t1, $t0
	la $t2, 0($gp)  # load the display address
	add $t1, $t1, $t2  # add the pixel offset to the display address
	addi $sp, $sp, -4 
	sw $t1, 0($sp)  # store the beginning pixel in the stack
	
	# pass the area of the sprite
	addi $t0, $zero, 4096
	addi $sp, $sp, -4 
	sw $t0, 0($sp)
	
	# pass the row width of the sprite
	addu $t0, $zero, 128
	addi $sp, $sp, -4
	sw $t0, 0($sp)

	jal DrawSprite
	
	addi $s0, $s0, 168  # increment the x offset for the next log
	j DrawShortLogLoop
EndShortLogLoop:	
	# load the current $ra
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra


DrawTurtle:
	lw $s2, 0($sp)  # load the y position value into $s2
	addi $sp, $sp, 4
	
	lw $s1, 0($sp)  # load the x position value into $s1
	addi $sp, $sp, 4
	
	addi $sp, $sp, -4
	sw $ra, 0($sp)  # store the current $ra value
	add $s0, $zero, $zero  # initialize the x offset to zero
DrawTurtleLoop:
	beq $s0, 504, EndShortLogLoop  # if the loop has iterated three times, end it
	
	# pass the sprite into the function
	addi $sp, $sp, -4 
	la $t1, turtleSprite
	sw $t1, 0($sp) 
	
	# pass the beginning pixel into the function
	add $t0, $zero, $s1  # load the x position of the log into $t0
	add $t0, $t0, $s0  # add the x offset to the x position
	
	blt $t0, 512, StoreFirstTurtlePixelPosition  # if the x position is greater than 512 due to the offset
	addi $t0, $t0, -512  # subtract 512 from it, that is, $t0 = $t0 % 512
StoreFirstTurtlePixelPosition:
	add $t1, $zero, $s2  # load the y position of the frog into $t1
	# calculate the beginning pixel of the sprite
	add $t1, $t1, $t0
	la $t2, 0($gp)  # load the display address
	add $t1, $t1, $t2  # add the pixel offset to the display address
	addi $sp, $sp, -4 
	sw $t1, 0($sp)  # store the beginning pixel in the stack
	
	# pass the area of the sprite
	addi $t0, $zero, 4096
	addi $sp, $sp, -4 
	sw $t0, 0($sp)
	
	# pass the row width of the sprite
	addu $t0, $zero, 128
	addi $sp, $sp, -4
	sw $t0, 0($sp)

	jal DrawSprite
	
	addi $s0, $s0, 168  # increment the x offset for the next log
	j DrawTurtleLoop
EndTurtleLoop:	
	# load the current $ra
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra


DrawRow3Log:
	addi $sp, $sp, -4
	sw $ra, 0($sp)  # store the current $ra value
	add $s0, $zero, $zero  # initialize the x offset to zero
DrawRow3LogLoop:
	beq $s0, 512, EndRow3LogLoop  # if the loop has iterated three times, end it
	
	# pass the sprite into the function
	addi $sp, $sp, -4 
	la $t1, longLog
	sw $t1, 0($sp) 
	
	# pass the beginning pixel into the function
	addi $sp, $sp, -4 
	lw $t0, row3X  # load the x position of the log into $t0
	add $t0, $t0, $s0  # add the x offset to the x position
	
	blt $t0, 512, StoreFirstRow3LogPixelPosition  # if the x position is greater than 512 due to the offset
	addi $t0, $t0, -512  # subtract 512 from it, that is, $t0 = $t0 % 512
StoreFirstRow3LogPixelPosition:
	lw $t1, row3Y  # load the y position of the frog into $t1
	# calculate the beginning pixel of the sprite
	add $t1, $t1, $t0
	la $t2, 0($gp)  # load the display address
	add $t1, $t1, $t2  # add the pixel offset to the display address

	sw $t1, 0($sp)  # store the beginning pixel in the stack
	
	# pass the area of the sprite
	addi $sp, $sp, -4 
	addi $t0, $zero, 4096
	sw $t0, 0($sp)
	
	# pass the row width of the sprite
	addi $sp, $sp, -4
	addu $t0, $zero, 192
	sw $t0, 0($sp)

	jal DrawSprite
	
	addi $s0, $s0, 256  # increment the x offset for the next log
	j DrawRow3LogLoop
EndRow3LogLoop:	
	# load the current $ra
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra


DrawSprite:
	la $t0, 0($gp)  # $t0 stores the base address for display
	
	lw $a3, 0($sp)  # load the width of each row
	addi $sp, $sp, 4  # pop the stack
	
	lw $a2, 0($sp)  # load the size of the sprite
	addi $sp, $sp, 4  # pop the stack
	
	lw $a1 0($sp)   # load the beginning pixel position in $a1
	addi $sp, $sp, 4  # pop the stack
	
	lw $a0 0($sp)  # load the address of the sprite in $a0
	addi $sp, $sp, 4  # pop the stack
	
	add $t2, $a1, $a2  # set $t2 as the end position
	addi $a1, $a1, -512 # decrement to get correct starting positing (because we increment at start of loop)
SpriteColumns:
	addi $a1, $a1, 512  # increment the starting position to the next row
	beq $a1, $t2, StopDrawingSprite
	add $t3, $a1, $zero  # set $t3 = $a1 the starting position
	add $t4, $t3, $a3  # set $t4 pixels away from $t3
SpriteRows:
	# $t3 is the current position of the pixel
	# $t4 is the desired end position of the pixel
	beq $t3, $t4, SpriteColumns  # if we reached end of row go to next column
	# store a secondary copy of the current position
	add $t7, $zero, $t3
	sub $t5, $t3, $t0  # get the current position in pixels
	sub $t6, $a1, $t0  # get current row start in pixels
	# round the current row start to the next multiple of 512 / column
	srl $t6, $t6, 9
	sll $t6, $t6, 9
	addi $t6, $t6, 512
	# if the current position goes to the next row then decrease $t7 by one row
	blt $t5, $t6, ContinueSpriteLoop
	addi $t7, $t7, -512
ContinueSpriteLoop:	
	lw $t1, 0($a0) # load the pixel color at this position
	sw $t1, 0($t7)  # paint the pixel at $t3
	addi $t3, $t3, 4  # increment $t2 to the next pixel position
	addi $a0, $a0, 4  # increment $a0 to next pixel color
	j SpriteRows
StopDrawingSprite:
	jr $ra


DrawFrog:
	la $t0, 0($gp)  # $t0 stores the base address for display
	lw $a0, 0($sp) # store the current frog sprite in $a0
	addi $sp, $sp, 4
	lw $a1, 0($sp)  # load the x position of the frog
	addi $sp, $sp, 4
	lw $a2, 0($sp)  # load the y position of the frog
	addi $sp, $sp, 4
	
	mul $a2, $a2, 128  # multiply y with 128 to get the number of rows in pixels
	add $a1, $a1, $a2 # add $t5 and $t6 together to get the position in total pixels (rows + shift right)
	add $t1, $t0, $a1 # the place to start drawing from
	addi $t2, $t1, 4096  # set $t2 as the end position
	addi $t1, $t1, -512 # decrement to get correct starting positing (because we increment at start of loop)
FrogColumns:
	addi $t1, $t1, 512  # increment the starting position to the next row
	beq $t1, $t2, StopDrawingFrog
	add $t3, $zero, $t1  # set $t3 = $t1
	addi $t4, $t3, 32  # set $t4 pixels away from $t3
FrogRows:
	# $t3 is the current position of the pixel
	# $t4 is the desired end position of the pixel
	beq $t3, $t4, FrogColumns  # if we reached end of row go to next column
	lw $t7, 0($a0) # load the pixel color at this position
	beq $t7, 0, NextFrogPixel  # if the pixel is black, don't draw it
	sw $t7, 0($t3)  # otherwise paint the pixel at $t3
NextFrogPixel:
	addi $t3, $t3, 4  # increment $t2 to the next pixel position
	addi $a0, $a0, 4  # increment $a0 to next pixel color
	j FrogRows
StopDrawingFrog:
	jr $ra
	
	
DrawSafeZone:
	la $t0, 0($gp) # $t0 stores the base address for display
	lw $a0, 0($sp) # load the position of the safe zone from the stack
	addi $sp, $sp, 4  # pop the stack
	add $t1, $t0, $a0  # define start location at (512, 504)
	addi $t2, $t1, 4096 # define end location at (512, 512)
	la $t3, safeZone  # store the address of the sprite colors in $t3
DrawSafeZoneLoop: 
	beq $t1, $t2, StopSafeZoneLoop # if end pixel is reached, stop drawing
	lw $t4, 0($t3)  # load the color from the sprite into $t4
	sw $t4, 0($t1)	# draw the pixel on the screen
	addi $t1, $t1, 4 #increment the position counter to the next pixel
	addi $t3, $t3, 4 # increment by 4 to get to the next pixel color
	j DrawSafeZoneLoop
StopSafeZoneLoop:
	jr $ra


DrawRoad:
	la $t0, 0($gp) # $t0 stores the base address for display
	lw $t5, row6Y  # load the start of the safe zone
	add $t1, $t0, $t5  # set $t1 to the start of the safe zone of the display
	addi $t2, $t0, 61440  # set $t2 to the endpoint of the display
	lw $t3, black  # load the color black into $t3
DrawRoadLoop: 
	beq $t1, $t2, ExitDrawRoadLoop  # if we draw every pixel up to and including the last one exit the loop
	sw $t3, 0($t1)  # draw the pixel at the location $t1
	addi $t1, $t1, 4  # increment $t1 to the next pixel
	j DrawRoadLoop  # restart the loop
ExitDrawRoadLoop:
	jr $ra 

	
DrawWater:
	la $t0, 0($gp) # $t0 stores the base address for display and the starting pixel i.e the top left corner
	lw $t5, safeZonePos    # load the start of the safe zone
	add $t2, $t0, $t5    # set $t2 to the endpoint of the display
	lw $t1, row1Y
	add $t0, $t1, $t0
	lw $t3, waterBlue  # load the color black into $t3
DrawWaterLoop:
	beq $t0, $t2, ExitDrawWaterLoop  # if we draw every pixel up to and including the last one exit the loop
	sw $t3, 0($t0)  # draw the pixel at the location $t1
	addi $t0, $t0, 4  # increment $t1 to the next pixel
	j DrawWaterLoop  # restart the loop
ExitDrawWaterLoop:
	jr $ra 
	
	
DrawGoalRegion:
	la $t0, 0($gp)
	addi $t1, $t0, 8192  # assign the start position
	addi $t2, $t1, 8192  # end position which is $128x16 pixels away from start position
	la $t3, goalRegion  # load the goal region sprite
DrawGoalRegionLoop:
	beq $t1, $t2, ExitDrawGoalRegionLoop
	lw $t4, 0($t3)  # load the color of the pixel
	sw $t4, 0($t1)  # draw the pixel at location $t1
	addi $t1, $t1, 4  # increment the location of the pixel by 1
	addi $t3, $t3, 4  # increment the color pointer by 1
	j DrawGoalRegionLoop
ExitDrawGoalRegionLoop:
	jr $ra
	

ResetGoalFrogs:
	add $t0, $zero, $zero  # loop iteration
	la $t1, goalFrogs  # load the address of the goal frogs
ResetGoalFrogsLoop:
	beq $t0, 5, EndResetGoalFrogs
	sw $zero, 0($t1)
	addi $t1, $t1, 4
	addi $t0, $t0, 1
	j ResetGoalFrogsLoop
EndResetGoalFrogs:
	jr $ra

DrawPlayAgainScreen:
	# store the return address
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	# pass the sprite into the draw function
	la $t0, retryScreen
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	
	# pass the beginning pixel of the sprite
	la $t1, 0($gp)
	addi $t1, $t1, 16384
	addi $sp, $sp, -4 
	sw $t1, 0($sp)  # store the beginning pixel in the stack
	
	# pass the area of the sprite
	addi $t0, $zero, 32768
	addi $sp, $sp, -4 
	sw $t0, 0($sp)
	
	# pass the row width of the sprite
	addu $t0, $zero, 512
	addi $sp, $sp, -4
	sw $t0, 0($sp)

	jal DrawSprite
	
	lw $ra, 0($sp)
	addi $sp, $sp, -4
	jr $ra

DrawBlackScreen:
	la $t0, 0($gp) # $t0 stores the base address for display
	addi $t1, $t0, 65536
	lw $t2, black
DrawBlackScreenLoop: 
	beq $t0, $t1, ExitDrawBlackScreenLoop  # if we draw every pixel up to and including the last one exit the loop
	sw $t2, 0($t0)  # draw the pixel at the location $t1
	addi $t0, $t0, 4  # increment $t1 to the next pixel
	j DrawBlackScreenLoop  # restart the loop
ExitDrawBlackScreenLoop:
	jr $ra 

Sleep:
	li $v0, 32
	li $a0, 16  # sleep by 1/60 of a second
	syscall
	jr $ra
				
Exit:
	li $v0, 10 # terminate the program gracefully
	syscall
